import styled from "styled-components"

const Name = styled.p`
    position: absolute;
    right: 40px;
    top:25px;
    font-size:20px;
`

const Date = styled.p`
    position: absolute;
    left: 100px;
    top:30px;
    font-size:15px;
`

const Content = styled.p`
    position: absolute;
    left: 40px;
    top:60px;
    font-size:20px;
`

export { Name, Date, Content };
